import React, { useState, useEffect } from "react";
import FormData from "form-data";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom";

const EditProfilePage = () => {
  const { id } = useParams();
  const [username, setUsername] = useState("");
  const [email, setEmail] = useState("");
  const [location, setLocation] = useState("");
  const [interests, setInterests] = useState("");
  const [image, setImage] = useState({});
  
  const fileonChange = (event) => {
    setImage(event.target.files[0]);
  };

  const sendImage = () => {
    const formData = new FormData();
    formData.append("pic", image);
  
    axios
      .post("http://localhost:4000/uploads/user/", formData)
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  

  useEffect(() => {
    axios
      .get(`http://localhost:4000/users/${window.localStorage.getItem('userid')}`)
      .then((res) => {
        const { Username, email, location, interests } = res.data;
        setUsername(Username);
        setEmail(email);
        setLocation(location);
        setInterests(interests);
      })
      .catch((err) => console.log(err));
  }, [id]);

  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    axios
      .put(`http://localhost:4000/users/${window.localStorage.getItem('userid')}`, {
        username: username,
        email,
        location,
        interests,
      })
      .then(() => {
        setUsername(window.localStorage.setItem(`username`,username))
        navigate("/ProfilePage");
      })
      .catch((err) => console.log(err));
  };

  return (
    <div className="container">
      <div className="row justify-content-center align-items-center">
        <div className="col-md-6">
          <h2>Edit Profile</h2>
          <form onSubmit={(e) => {
  e.preventDefault();
  sendImage();
  handleSubmit(e);
}}>

            <div className="mb-3">
              <div>
                <input type="file" onChange={fileonChange} />
              </div>
              <label htmlFor="username" className="form-label">
                Username
              </label>
              <input
                type="text"
                className="form-control"
                id="username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
              />
            </div>
            <div className="mb-3">
              <label htmlFor="email" className="form-label">
                Email
              </label>
              <input
                type="email"
                className="form-control"
                id="email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>
            <div className="mb-3">
              <label htmlFor="location" className="form-label">
                Location
              </label>
              <input
                type="text"
                className="form-control"
                id="location"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
              />
            </div>
            <div className="mb-3">
              <label htmlFor="interests" className="form-label">
                Interests
              </label>
              <input
                type="text"
                className="form-control"
                id="interests"
                value={interests}
                onChange={(e) => setInterests(e.target.value)}
              />
            </div>
            <button type="submit" className="btn btn-primary">
              Save Changes
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default EditProfilePage;
